import React from 'react'

// const key = 'b4a1e8d25cdbd70b76c1c854d2204b32'


export default class Weather2 extends React.Component {

    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                {this.props.city}
                {this.props.temp}
            </div>
        )
    }
}

